import React, { Component } from "react";
import Body from "./componentes/Body";
import Footer from "./componentes/Footer";
import MainHeader from "./componentes/MainHeader";
import NavBar from "./componentes/NavBar";
import { BrowserRouter as Router, Route, Link, Routes} from "react-router-dom";
import Home from "./pages/Home";
import Horarios from "./pages/Horarios";
import Materiales from "./pages/Materiales";
import Salas from "./pages/Salas";
import './App.css'
//import {Button} from 'reactstrap'

class App extends Component{
  //super
  //constructor
  render(){
    return(
      <div class="container">
        <div >
          <MainHeader/>
          <Router>
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <Link class="navbar-brand"to="/">Home</Link>
            <Link class="navbar-brand"to="/">Salas</Link>
            <Link class="navbar-brand"to="/">Materiales</Link>
            <Link class="navbar-brand"to="/">Salas</Link>
            </nav>
            <Routes>
              <Route exact path="/" element={<Home/>}></Route>
              <Route exact path="Salas" element={<Salas/>}></Route>
              <Route exact path="Materiales" element={<Materiales/>}></Route>
              <Route exact path="Salas" element={<Salas/>}/>     
            </Routes>
          </Router>
        </div>
      <Footer/>
      </div>
    );
  }
}
export default App;
